import React, { Component } from 'react';
import Header from './../components/Header';
import Footer from './../components/Footer';
import MainFFirst from '../components/aboutWatch/MainFirst1';
import mac1 from './../img/mac1.PNG';
class AboutWatch extends Component {
    render() {
        return (
            <div>
                <Header/>
                <section>
                <div className="container">
                <MainFFirst />
                <div className='col-xl-6'>
                   <div className="header-l">
                       <img src={mac1} alt=""/>
                   </div>
                   <h2 class="title"><a href="https://xwatch.vn/ve-xwatch/tong-hop-chung-nhan-dong-ho-chinh-hang-tai-xwatch-minh-chung-cho-su-uy-tin-n956402.html" title="Tổng hợp chứng nhận đồng hồ chính hãng tại Xwatch - Minh chứng cho sự uy tín">Tổng hợp chứng nhận đồng hồ chính hãng tại Xwatch - Minh chứng cho sự uy tín</a></h2>
                   <div class="datetime">
					20/05/2019				
                    </div>
                    <div class="summary">Xwatch được biết đến là đơn vị phân phối đồng hồ chính hãng uy tín tại Việt Nam. Sở hữu...</div>
                   </div>
                   </div>
                </section>
                <Footer/>
            </div>
        );
    }
}

export default AboutWatch;
